	    arrayEach(args, function(x, i) { check(x, isNumber, "*", "number", i+1) });
	    var i, prod = plt.types.Rational.ONE;
	    for(i = 0; i < args.length; i++) {
		prod = plt.types.NumberTower.multiply(prod, args[i]);
	    }
	    return prod;    
